import React, { Component, Fragment } from "react";
import { Link } from "react-router-dom";
import { Navbar, Nav } from "react-bootstrap";

const right = {
  textAlign: "right"
};

export class Footer extends Component {
  render() {
    return (
      <footer class="footer">
        <ul id="parent">
          <li class="container">
            <p id="name">&copy; 2020 Adam Pikielny</p>
          </li>
          <li class="container">
            <a href="https://github.com/APikielny" target="_blank">
              GitHub
            </a>
          </li>
        </ul>
      </footer>
    );
  }
}

export default Footer;
